import React,{ Fragment } from 'react';

const RenderPage = ( props ) => {
  console.log('after submit Render page : ',props.data);
  const renderData = ( ) => {
    return props.data && Object.values(props.data).map((el,i) => {
      console.log(el.movieName)
          return (
          <Fragment key={ i }>
            <td>{el }</td>
            <td>{ el }</td>
            <td>{el }</td>
          </Fragment>
          );
    })
  }
    return (
      <div>
        <table className="ui celled table">
            <thead>
                  <tr>
                <th>Movie Name</th>
                <th>Ratings</th>
                <th>Duration</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                { renderData() }
              </tr>
            </tbody>
          </table>
      </div>
    );
}

export default RenderPage;
